import React from 'react'

export default function Gallery({rects, handleRemoveRect}) {

    return (
        <div>
            <h1>Galeria</h1>
            {rects && <ul>
                {rects.map((rect, id) =>
                <li key={id} >{rect}</li>)}
                <button onClick={() => handleRemoveRect({id})}>Remove</button>
            </ul>}
        </div>
    )
}
